import React from 'react';
import {
  Jumbotron,
  Button,
  Container
} from "reactstrap";

const Home = () => {
  return (
    <React.Fragment>
      <br />
      <br />
      <br />
      <br />
      <br />
      <br />
      <Container>
        <Jumbotron>
          <center>
            <h1 className="display-1">Blog</h1>
          </center>
        </Jumbotron>
      </Container>
    </React.Fragment>
  )
}

export default Home;
